CREATE DEFINER=`root`@`localhost` PROCEDURE `6511353` (IN `request` JSON)   proc: BEGIN
DECLARE sdate varchar(15);
DECLARE pdate varchar(15);
DECLARE chartCount int;
DECLARE tabledata json;
DECLARE tableCount int;
SET sdate = JSON_VALUE(request,'$.startDate');
SET pdate = JSON_VALUE(request,'$.stopDate');
set chartCount = (select count(bm.created_date) FROM billmaster bm WHERE bm.created_date BETWEEN sdate and pdate);
set tabledata = (select JSON_OBJECT('tabledata',JSON_ARRAY(GROUP_CONCAT(JSON_OBJECT( 'cmId',cm.cmpId,'remark',cm.remark,'vnumber',vm.vNumber,'name',cma.name,'mobile',cma.mobile,'username',u.Name,'address',cma.place,'vdate',cm.visitDate,'status',cm.status)))) from complaintmaster cm inner join users u on u.aid = cm.userid inner join vehiclemaster vm on vm.vId = cm.vId inner join customermaster cma on cma.cId = vm.cId where cm.visitDate BETWEEN sdate and pdate ORDER by cm.visitDate DESC);
set tableCount = JSON_LENGTH(JSON_EXTRACT(tabledata,'$.tabledata'));
if chartCount > 0 or tableCount > 0  then
SELECT JSON_OBJECT('errorCode',0,'result',JSON_OBJECT('chart',JSON_ARRAY(GROUP_CONCAT(JSON_OBJECT('date',ldate,'amount',asum))),'tableData',JSON_EXTRACT(tabledata,'$.tabledata'))) as result FROM ( select DATE_FORMAT(bm.created_date, "%c/%d/%Y") as ldate,sum(bm.total) as asum FROM billmaster bm WHERE bm.created_date BETWEEN sdate and pdate GROUP BY bm.created_date ) t;
else
  SELECT JSON_OBJECT('errorCode',1,'errorMsg','not data') as result;
  end if;
END$$

