DECLARE user varchar(30);
DECLARE pass varchar(30);
SET user = JSON_VALUE(request,'$.username');
SET pass = JSON_VALUE(request,'$.password');
set stas = (SELECT status from users u where username = user and password = pass);
IF stas IS NOT NULL THEN
  IF stas = 0 THEN
  set stas = (SELECT u.aid from users u where username = user and password = pass);
  SELECT JSON_OBJECT('errorCode',1,                 'result',JSON_OBJECT('name',u.name,'aid',u.aid,'userType',um.user,'mobile',u.mobile)) as result from users u INNER JOIN usermaster um on um.id = u.userId where u.aid = stas;
