	SELECT JSON_OBJECT('errorCode',0,'errorMsg','User Blocked Contact admin') as     result;
  ELSE 
	SELECT JSON_OBJECT('errorCode',0,'errorMsg','User removed') as result;
	END IF ;
ELSE
SELECT JSON_OBJECT('errorCode',0,'errorMsg','Wrong user / password') as result;
END IF;
END$$

